   286→        <h1 id="firstHeading">Chronolinguistics</h1>
   287→        <div id="siteSub">From Wikipedia, the free encyclopedia</div>
   288→        <div id="contentSub"><i>Not to be confused with <a href="/wiki/Historical_linguistics">historical linguistics</a> or <a href="/wiki/Linguistic_dating">linguistic dating</a>.</i></div>
   289→
   290→        <table class="ambox">
   291→            <tr>
