   311→            </tr>
   312→            <tr>
   313→                <th scope="row">Founder</th>
   314→                <td>Dr. Margaux Fontaine, Henrik Voss</td>
   315→            </tr>
   316→            <tr>
   317→                <th scope="row">Key concepts</th>
   318→                <td>Temporal-lexical coupling, Chronosemantic decay, Tense erosion</td>
   319→            </tr>
   320→            <tr>
   321→                <th scope="row">Related concepts</th>
   322→                <td><a href="lexical-half-life.html">Lexical half-life</a>, <a href="temporal-debt.html">Temporal debt</a>, <a href="semantic-drift.html">Semantic drift</a></td>
   323→            </tr>
   324→        </table>
   325→
   326→        <p><b>Chronolinguistics</b> is an interdisciplinary field studying the bidirectional relationship between <a href="/wiki/Time_perception">time perception</a> and <a href="/wiki/Language">language</a>. Unlike traditional <a href="/wiki/Historical_linguistics">historical linguistics</a>, which examines how languages change over time, chronolinguistics investigates how language itself shapes and is shaped by the human experience of temporality—including the phenomena of <a href="temporal-debt.html">temporal debt</a>, <a href="lexical-half-life.html">lexical decay</a>, and <a href="semantic-drift.html">semantic drift</a>.<sup><a href="#cite1">[1]</a></sup></p>
   327→
   328→        <p>The field emerged from a 2014 collaboration between linguist Dr. Margaux Fontaine of <a href="/wiki/McGill_University">McGill University</a> and chronopsychologist Henrik Voss of the <a href="/wiki/University_of_Oslo">University of Oslo</a>, who observed that populations experiencing high levels of temporal debt exhibited accelerated rates of <a href="lexical-half-life.html">lexical half-life</a> decay. Their initial paper, "When Time Eats Words," proposed that the experience of time and the stability of meaning are fundamentally coupled phenomena.<sup><a href="#cite2">[2]</a></sup></p>
   329→
