   304→        <h1 id="firstHeading">Temporal linguistics engineering</h1>
   305→        <div id="siteSub">From Wikipedia, the free encyclopedia</div>
   306→        <div id="contentSub"><i>Not to be confused with <a href="/wiki/Language_planning">language planning</a> or <a href="/wiki/Linguistic_engineering">computational linguistic engineering</a>.</i></div>
   307→
   308→        <table class="ambox">
   309→            <tr>
   310→                <td><b>This article describes techniques that may alter meanings retroactively.</b> Reader comprehension of this article may differ from authorial intent at time of writing. <small><i>(January 2026)</i></small></td>
   311→            </tr>
   312→        </table>
   313→
   314→        <table class="infobox">
   315→            <tr>
   316→                <td colspan="2" class="infobox-title">Temporal Linguistics Engineering</td>
   317→            </tr>
   318→            <tr>
   319→                <th scope="row">Also known as</th>
   320→                <td>Chrono-semantic engineering, Meaning trajectory design, Prospective semantics</td>
   321→            </tr>
   322→            <tr>
   323→                <th scope="row">Field</th>
   324→                <td><a href="chronolinguistics.html">Chronolinguistics</a>, <a href="semantic-stratigraphy.html">Semantic stratigraphy</a>, <a href="/wiki/Applied_linguistics">Applied linguistics</a></td>
   325→            </tr>
   326→            <tr>
   327→                <th scope="row">Proposed</th>
   328→                <td>2025</td>
   329→            </tr>
   330→            <tr>
   331→                <th scope="row">Proposed by</th>
   332→                <td>Dr. Fiona MacLeod, Dr. Kazuki Morrison</td>
   333→            </tr>
   334→            <tr>
   335→                <th scope="row">Institution</th>
   336→                <td>Edinburgh Institute for Temporal Studies</td>
   337→            </tr>
   338→            <tr>
   339→                <th scope="row">Key concepts</th>
   340→                <td>Semantic trajectory, Meaning futures, Depositional steering, Drift vectors</td>
   341→            </tr>
   342→            <tr>
   343→                <th scope="row">Related concepts</th>
   344→                <td><a href="semantic-stratigraphy.html">Semantic stratigraphy</a>, <a href="semantic-drift.html">Semantic drift</a>, <a href="lexical-half-life.html">Lexical half-life</a></td>
   345→            </tr>
   346→        </table>
   347→
   348→        <p><b>Temporal linguistics engineering</b> (TLE) is an emerging applied field within <a href="chronolinguistics.html">chronolinguistics</a> that seeks to intentionally shape the future evolution of language by manipulating the conditions under which meaning develops and deposits. First proposed by Dr. Fiona MacLeod and Dr. Kazuki Morrison at the Edinburgh Institute for Temporal Studies in 2025, TLE applies insights from <a href="semantic-stratigraphy.html">semantic stratigraphy</a> and <a href="echo-cartography.html">echo cartography</a> to design interventions that guide how words, concepts, and entire semantic fields will change over time.<sup><a href="#cite1">[1]</a></sup></p>
   349→
   350→        <p>Unlike <a href="semantic-hygiene.html">semantic hygiene</a>, which focuses on preserving existing meanings against decay, or traditional <a href="/wiki/Language_planning">language planning</a>, which addresses immediate policy concerns, temporal linguistics engineering takes a prospective approach—designing meaning trajectories that unfold over years or decades. Practitioners describe it as "planting seeds in the <a href="mnemonic-commons.html">mnemonic commons</a> that will bloom into specific semantic configurations in the future."<sup><a href="#cite2">[2]</a></sup></p>
   351→
   352→        <div id="toc">
   353→            <h2>Contents</h2>
   354→            <ul>
   355→                <li><span class="tocnumber">1</span> <a href="#Theoretical_foundations">Theoretical foundations</a>
   356→                    <ul>
   357→                        <li><span class="tocnumber">1.1</span> <a href="#Predictive_stratigraphy">Predictive stratigraphy</a></li>
   358→                        <li><span class="tocnumber">1.2</span> <a href="#Drift_vector_manipulation">Drift vector manipulation</a></li>
   359→                        <li><span class="tocnumber">1.3</span> <a href="#Depositional_steering">Depositional steering</a></li>
   360→                    </ul>
   361→                </li>
   362→                <li><span class="tocnumber">2</span> <a href="#Methodology">Methodology</a>
   363→                    <ul>
   364→                        <li><span class="tocnumber">2.1</span> <a href="#Trajectory_modeling">Trajectory modeling</a></li>
   365→                        <li><span class="tocnumber">2.2</span> <a href="#Intervention_design">Intervention design</a></li>
   366→                        <li><span class="tocnumber">2.3</span> <a href="#Monitoring">Temporal monitoring</a></li>
   367→                    </ul>
